import React, { Component } from 'react';
import $ from 'jquery';

class Events extends Component {
    constructor(props) {
        super(props);
        this.state = {
            usersubscribeTo: this.props.value.subscribeTo,
            events : {}
        }
    }

    componentDidMount() {
        let events = [];
        const url = "http://localhost:3000/events";

        fetch(url)
            .then(response => response.json())
            .then(res => {
                console.log(res.events)
                console.log(this.state.usersubscribeTo)
                $.each(this.state.usersubscribeTo, function (i, val) {
                    $.each(res.events, function (index, value) {
                        if (val === value.name) {
                            events.push({
                                id: value.id,
                                name: value.name,
                                description: value.description,
                                start: value.start,
                                end: value.end,
                                location: value.location
                            });
                        }

                    });
                })

                this.setState(() => ({ events }));

            }).catch(() => console.log("Canâ€™t access " + url + " response. Blocked by browser?"));
    }

    render() {
        let { events } = this.state;

        let eventList = this.events.map((item, index) => {
            <table className="table table-borderless">
            <tbody>
                <tr key={item} >
                    <td >
                        User Name :
                    </td>
                    <td>
                        <input type="text" className="form-control" value={value.name} readOnly />
                    </td>
                </tr>
                <tr key={index + value.surname} >
                    <td>
                        User Surname :
                    </td>
                    <td>
                        <input type="text" className="form-control" value={value.surname} readOnly />
                    </td>
                </tr>
                <tr key={index + value.Email} >
                    <td>
                        User Email :
                    </td>
                    <td>
                        <input type="text" className="form-control" value={value.Email} readOnly />
                    </td>
                </tr>
                <tr key={index + value.userGroup} >
                    <td>
                        User Group :
                    </td>
                    <td>
                        <input type="text" className="form-control" value={value.userGroup} readOnly />
                    </td>
                </tr>
                <tr key={index + value.subscribeTo.join()} >
                    <td>
                        User Subscribes To :
                    </td>
                    <td>

                        <input
                            type="text"
                            className="form-control"
                            value={value.subscribeTo.join(', ')}
                            readOnly
                        />
                    </td>
                </tr>
            </tbody>
        </table>
        })

        return (<div>{ eventList }</div>);
    }
}

export default Events;
